INSERT INTO `kategori` (`id_kategori`, `namakategori`, `gambar`, `ket`, `namakategori_en`, `ket_en`, `user_id`, `hapus`, `user`) VALUES
(5, 'RUBBER FENDER SNI DAN TKDN', 'IMG-20230319-WA0003.jpg', 'RUBBER FENDER SNI DAN TKDN\r\nRubber Fender    adalah produk yang terbuat dari karet yang biasa digunakan sebagai bumper atau pelindung benda dari benturan. Selain itu, juga untuk menyerap energi benturan saat terjadi kontak antara kapal dengan dermaga maupun kapal satu dengan kapal lainnya. \r\n', 'RUBBER FENDER SNI AND TKDN', 'RUBBER FENDER SNI AND TKDN\r\nRubber Fender is a product made of rubber that is commonly used as a bumper or protector of objects from impact. In addition, it also absorbs impact energy when there is contact between a ship and a dock or one ship with another.', NULL, 0, 'Admin Gema'),
(6, 'BOLLARD SNI DAN TKDN', 'IMG-20230318-WA00031.jpg', 'Bollard adalah perangkat pelabuhan untuk menambatkan kapal di dermaga atau perangkat untuk mengikatkan tali di kapal. Bollard biasanya terbuat dari besi cor ( cost iron) dan diangker/ditanamkan pada fondasi dermaga sehingga mampu untuk menahan gaya yang bekerja kapal di dermaga. ', 'BOLLARD SNI DAN TKDN', 'Bollard is a port device for mooring ships at a dock or a device for tying ropes to ships. Bollards are usually made of cast iron (cost iron) and are anchored/embedded in the dock foundation so that they are able to withstand the forces acting on the ship at the dock.', NULL, 0, 'Admin Gema'),
(7, 'FRONTAL FRAME', 'IMG-20230318-WA0048.jpg', 'Frontal Frame Fender adalah alat perkapalan fender laut atau dermaga , pada Frontal frame fender tepian dinding dermaga yang memiliki fungsi utama sebagai penahan energy yang di hasilkan oleh benturan yang kerap terjadi antara kapal-kapal yang bersandar di dermaga dengan dinding dermaga.', 'FRONTAL FRAME', 'Frontal Frame Fender is a marine or dock fender shipping tool, on the Frontal frame fender the edge of the dock wall has the main function as a retainer of energy generated by collisions that often occur between ships docked at the dock and the dock wall.', NULL, 0, 'Admin Gema'),
(8, 'ACCESSORIES DERMAGA', 'IMG-20230320-WA0055.jpg', '. ', 'DOCK ACCESSORIES', '. ', NULL, 0, 'Admin Gema'),
(9, 'STOK RUBBER FENDER', 'IKLAN.png', 'STOK READY \r\nRubber Fender atau Accessories lainya. ', 'STOK RUBBER FENDER', 'READY STOCK \r\nRubber Fender or other Accessories.', NULL, 0, 'Admin Gema'),
(10, 'AAM', '1741852701_WhatsApp_Image_2025', 'KETERANGAN', NULL, NULL, 13, 1, 'Admin Gema'),
(11, 'AAM (Edit)', '1741853558_WhatsApp_Image_2025-02-25_at_16_18_12.jpeg', 'AAM (edit) tes', 'AAM (Edit)', 'AAM (edit) tes', 13, 1, 'Admin Gema');
