(9, 'FRONTAL FRAME TYPE I ', 7, 'IMG-20230318-WA0042.jpg', '<p>Untuk spek FRONTAL FRAME type I bisa menyesuaikan dengan kebutuhan di lapangan/ proyek.</p>\r\n', '<p>Untuk FRONTAL FRAME type I ini biasa/umunya di aplikasin dengan rubber fender type CONE, ELEMENT/PI, CELL FENDER.</p>\r\n', 'FRONTAL FRAME TYPE I ', '<p>For FRONTAL FRAME type I specifications, it can be adjusted to the needs in the field/project.</p>\r\n', '<p>For FRONTAL FRAME type I, it is usually/generally applied with rubber fender type CONE, ELEMENT/PI, CELL FENDER.</p>\r\n', NULL, 0, 'Admin Gema'),
