(16, 'RUBBER FENDER TYPE ANP SNI DAN TKDN', 5, 'IMG-20230322-WA0017.jpg', '<p>RUBBER FENDER ANP 150H SNI DAN TKDN, RUBBER FENDER ANP 200H SNI DAN TKDN, RUBBER FENDER ANP 250H SNI DAN TKDN, RUBBER FENDER ANP300H SNI DAN TKDN, RUBBER FENDER ANP 400H SNI DAN TKDN, RUBBER FENDER ANP 500H SNI DAN TKDN, RUBBER FENDER ANP 600H SNI DAN TKDN, RUBBER FENDER ANP 800H SNI DAN TKDN, RUBBER FENDER ANP 1000H SNI DAN TKDN, Untuk Panjang Fender bisa menyesuaikan kebutuhan. Yang di maksud dengan (H) adalah tinggi fender tersebut.</p>\r\n', '<p>RUBBER FENDER ANP 150H SNI DAN TKDN, RUBBER FENDER ANP 200H SNI DAN TKDN, RUBBER FENDER ANP 250H SNI DAN TKDN, RUBBER FENDER ANP300H SNI DAN TKDN, RUBBER FENDER ANP 400H SNI DAN TKDN, RUBBER FENDER ANP 500H SNI DAN TKDN, RUBBER FENDER ANP 600H SNI DAN TKDN, RUBBER FENDER ANP 800H SNI DAN TKDN, RUBBER FENDER ANP 1000H SNI DAN TKDN, Untuk Panjang Fender bisa menyesuaikan kebutuhan. Yang di maksud dengan (H) adalah tinggi fender tersebut.</p>\r\n', 'RUBBER FENDER TYPE ANP SNI DAN TKDN', '<p>RUBBER FENDER ANP 150H SNI AND TKDN, RUBBER FENDER ANP 200H SNI AND TKDN, RUBBER FENDER ANP 250H SNI AND TKDN, RUBBER FENDER ANP300H SNI AND TKDN, RUBBER FENDER ANP 400H SNI AND TKDN, RUBBER FENDER ANP 500H SNI AND TKDN, RUBBER FENDER ANP 600H SNI AND TKDN, RUBBER FENDER ANP 800H SNI AND TKDN, RUBBER FENDER ANP 1000H SNI AND TKDN, For the length of the fender can be adjusted to the needs. What is meant by (H) is the height of the fender.</p>\r\n', '<p>RUBBER FENDER ANP 150H SNI AND TKDN, RUBBER FENDER ANP 200H SNI AND TKDN, RUBBER FENDER ANP 250H SNI AND TKDN, RUBBER FENDER ANP300H SNI AND TKDN, RUBBER FENDER ANP 400H SNI AND TKDN, RUBBER FENDER ANP 500H SNI AND TKDN, RUBBER FENDER ANP 600H SNI AND TKDN, RUBBER FENDER ANP 800H SNI AND TKDN, RUBBER FENDER ANP 1000H SNI AND TKDN, For the length of the fender can be adjusted to the needs. What is meant by (H) is the height of the fender.</p>\r\n', NULL, 0, 'Admin Gema'),
