(19, 'RUBBER FENDER TYPE SQUARE', 5, 'FENDER_SQUARE.jpg', '<p>Rubber Fender Loading dock adalah produk yang terbuat dari karet yang biasa digunakan sebagai bumper atau pelindung benda dari benturan.. Rubber Square 100x100 , Rubber Square 150x150 , Rubber Square 200x200 , Rubber Square 250x250 , Rubber Square 300x300</p>\r\n', '<p>Rubber Fender Loading dock adalah produk yang terbuat dari karet yang biasa digunakan sebagai bumper atau pelindung benda dari benturan.. Rubber Square 100x100 , Rubber Square 150x150 , Rubber Square 200x200 , Rubber Square 250x250 , Rubber Square 300x300</p>\r\n', 'RUBBER FENDER TYPE SQUARE', '<p>Rubber Fender Loading dock is a product made of rubber which is commonly used as a bumper or protector of objects from impact. Rubber Square 100x100, Rubber Square 150x150, Rubber Square 200x200, Rubber Square 250x250, Rubber Square 300x300</p>\r\n', '<p>Rubber Fender Loading dock is a product made of rubber which is commonly used as a bumper or protector of objects from impact. Rubber Square 100x100, Rubber Square 150x150, Rubber Square 200x200, Rubber Square 250x250, Rubber Square 300x300</p>\r\n', NULL, 0, 'Admin Gema'),
