INSERT INTO `profil` (`id_profil`, `gambar`, `gambardua`, `namaperusahaan`, `isi`, `visi`, `misi`, `isi_en`, `visi_en`, `misi_en`, `user`, `email`, `telp`, `facebook`, `twitter`, `instagram`, `linkedin`, `alamat`, `embed_maps`) VALUES
(1, 'SSCF-instalation01.jpg', 'Rubber-Fender-Dermaga-Header.jpg', 'Gema Marina Nusantara', '<p style=\"text-align:justify\"><strong>CV GEMA MARINA NUSANTARA</strong>&nbsp;adalah Pabrik industri yang bergerak dibidang alat-alat pelabuhan dan dermaga. Produk Rubber Fender yang sudah bersertifikat SNI 06-3568-2006 , TKDN DAN ISO.</p>\r\n\r\n<p style=\"text-align:justify\">Kami memproduksi diantaranya: Rubber Fender Type Arch/V, M, Element/PI, Cylinder, Square, D, Cell Fender, Rubber Hose, Elastomer, BearingPads, Expansion Joint, Bollard, Frontal Frame, dan Accesories Fender lainnya lainnya seperti LAMPU PJU, dimana seluruh produksi telah kami kirim ke berbagai proyek-proyek renovasi dan pembangunan dermaga baru di seluruh wilayah Indonesia.</p>\r\n', '<p>Menjadi industri aksesoris dermaga yang handal dan berkualitas serta memberikan layanan terbaik dan terpercaya untuk mendukung perkembangan pembangunan dermaga di Indonesia.</p>\r\n', '<ol>\r\n	<li>Menyediakan produk aksesoris dermaga yang berkualitas dan berkomitmen kepada kepuasan pelanggan</li>\r\n	<li>Mengembangkan produk aksesoris dermaga untuk menjawab kebutuhan pelanggan.</li>\r\n	<li>Berkontribusi dalam pembangunan dermaga guna meningkatkan ekonomi sosial.</li>\r\n</ol>\r\n', '<p><strong>CV GEMA MARINA NUSANTARA </strong>is an industrial factory engaged in the field of port and dock equipment. Rubber Fender products that have been certified SNI 06-3568-2006, TKDN AND ISO.&nbsp;</p>\r\n\r\n<p>We produce including: Rubber Fender Type Arch / V, M, Element / PI, Cylinder, Square, D, Cell Fender, Rubber Hose, Elastomer, BearingPads, Expansion Joint, Bollard, Frontal Frame, and other Fender Accessories such as PJU LAMPS, where all production has been sent to various renovation projects and construction of new docks throughout Indonesia.</p>\r\n', '<p>To become a reliable and quality dock accessories industry and provide the best and most trusted services to support the development of dock construction in Indonesia.</p>\r\n', '<ol>\r\n	<li>Providing quality dock accessory products and committed to customer satisfaction</li>\r\n	<li>Developing dock accessory products to meet customer needs.</li>\r\n	<li>Contributing to dock development to improve social economy.</li>\r\n</ol>\r\n', 'Admin Gema', 'marketing@gemamarinanusantara.com', '082132657000', 'https://web.facebook.com/profile.php?id=100090678465573', 'https://twitter.com/', 'https://instagram.com/', 'https://linkedin.com/', 'Jabon Mekar, Kec. Parung, Kabupaten Bogor, Jawa Barat 16330', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7929.085583024104!2d106.725066!3d-6.452689!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e69e9ebaa1266e3%3A0x86503e70944e3ae7!2sGema%20Marina%20Nusantara!5e0!3m2!1sid!2sid!4v1744188707778!5m2!1sid!2sid\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>');
