INSERT INTO `slider` (`id_slider`, `gambar`, `nama`, `deskripsi`, `nama_en`, `deskripsi_en`, `user_id`, `hapus`, `user`) VALUES
(1, '1742021197_bggema.jpeg', 'Selamat Datang di Gema Marina Nusantara', 'Pabrik industri yang bergerak dibidang alat-alat pelabuhan dan dermaga. Produk Rubber Fender yang sudah bersertifikat SNI 06-3568-2006, TKDN DAN ISO', 'Welcome to Gema Marina Nusantara', 'Industrial factory engaged in the field of port and dock equipment. Rubber Fender products that have been certified SNI 06-3568-2006, TKDN AND ISO', 13, 0, 'Admin Gema'),
(2, '1742021278_SSCF-instalation01.jpg', 'Kenali Produk kami', 'Kami memproduksi diantaranya: Rubber Fender Type Arch/V, M, Element/PI, Cylinder, Square, D, Cell Fender, Rubber Hose, Elastomer, BearingPads, Expansion Joint, Bollard, Frontal Frame, dan Accesories Fender lainnya', 'Get to Know Our Products', 'We produce among others: Rubber Fender Type Arch/V, M, Element/PI, Cylinder, Square, D, Cell Fender, Rubber Hose, Elastomer, BearingPads, Expansion Joint, Bollard, Frontal Frame, and other Fender Accessories', 13, 0, 'Admin Gema'),
(3, '1742021303_Rubber-Fender-Dermaga-Header.jpg', 'Layanan kami', 'Kami mengutamakan kepuasan pelanggan dalam memberikan produk dan jasa sesuai permintaan pelanggan dengan menggunakan prosedur perusahaan yang mengacu kepada sistem manajemen mutu, peraturan pemerintah serta undang-undang yang berlaku.', 'Our Services', 'We prioritize customer satisfaction in providing products and services according to customer requests by using company procedures that refer to the quality management system, government regulations and applicable laws.', 13, 0, 'Admin Gema');
